import styled from "styled-components";

const Logo = styled.div`
display: inline-block;
color: ${props => props.theme.text};
  font-family: 'Pacifico', cursive;  
`

const LogoComponent = () => {
    return (
        <Logo>
            SeungHwan
        </Logo>
    )
}

export default LogoComponent;
